import React from 'react';

class CustomSelections2 extends React.Component {
    render() {
        console.log(this.props)
        return (
            <fieldset className="feature" key={'featureHash'}>
                <legend className="feature__name">
                    <h3>{'feature'}</h3>
                </legend>
                {'options'}
            </fieldset>
        );
    };
}

export default CustomSelections2;
